Reverts DefinitelyTyped/DefinitelyTyped#21127

The new typings are incompatible with function maps, like this:

```ts
import { pick } from 'lodash';

interface IGreeter {
    [species: string]: (name: string) => string;
}

const greet = pick<IGreeter>(
    { human: (name: string) => `hello ${name}` },
    ['human']
);

console.log(greet.human('connor'));
```

Errors with:

```
error TS2349: Cannot invoke an expression whose type lacks a call signature. Type 'PartialDeep<(name: string) => string>' has no compatible call signatures.
```

This PR removes the restriction on the number of arguments Jest's custom matchers can accept, which does not exist in Jest itself.

Jest allows you to define the following custom matcher for example which accepts 2 arguments:

```js
expect.extend({
  toBeWithinRange(received, floor, ceiling) {
    // implementation...
  }
});
```

The Jest typings currently state that a Jest matcher can only accept one argument.

A URL to documentation or source code which provides context for the suggested changes: https://facebook.github.io/jest/docs/en/expect.html#expectextendmatchers.

Thanks.

change to: types/hapi/index.d.ts
It is not possible to use HAPI "attache" plug-in with OptionsPassedToPlugin type of options property. 
Seems similar changes were done in other places of this file but not in mentioned file part.
After this change the configuration below is possible.

server.register([
    {
        register: attache,
        options: {
            service: {
                name: 'some custom service name'
            }
        }
    },

link to attache plugin: 
https://www.npmjs.com/package/attache
